import React from 'react'


class CurrentWeather extends React.Component{
    state={
        elements:[
            {id:'1',title:'title1'},
            {id:'2',title:'title2'}
        ]
    }
    render(){
        const elements = this.state.elements.map(e=>{
            return <WeatherItem element={e}/>
        })
        return(
            <div>
                Weather App
                {elements}
            </div>
        )
    }
}

export default CurrentWeather
